import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question(props) {

    const q = props.getquestionid(parseInt(props.id));
    console.log(q);

    return(
        <Paper>
            <h2>Title: {q.title}</h2>
            <p> Category: {q.category}</p>
            <h2>Question: {q.subtitle}</h2>
            <p>Up Votes: {q.upVote}</p>
        </Paper>
    )
}

export default Question;
